/*Table structure for table `crime_details` */

DROP TABLE IF EXISTS `crime_details`;

CREATE TABLE `crime_details` (
  `cd_id` int(10) NOT NULL auto_increment,
  `barangay` varchar(30) NOT NULL,
  `municipality` varchar(30) NOT NULL,
  `date_rep` date NOT NULL,
  `time_rep` time NOT NULL,
  `date_rec` date NOT NULL,
  `time_rec` time NOT NULL,
  `station` varchar(30) NOT NULL,
  `offense` varchar(30) NOT NULL,
  `crimestat` int(11) NOT NULL,
  `narrative_rep` varchar(1000) NOT NULL,
  `photo` varchar(500) NOT NULL,
  `lat` float(10,6) NOT NULL,
  `lng` float(10,6) NOT NULL,
  PRIMARY KEY  (`cd_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `crime_details` */

insert  into `crime_details`(`cd_id`,`barangay`,`municipality`,`date_rep`,`time_rep`,`date_rec`,`time_rec`,`station`,`offense`,`crimestat`,`narrative_rep`,`photo`,`lat`,`lng`) values (1,'Quitinday','camalig','2019-03-02','22:00:00','2019-03-02','22:30:00','PCT1','Rape',0,'hgfhfhdsdjhgjgj','1.jpg ',13.149464,123.645157);

/*Table structure for table `damage_report` */

DROP TABLE IF EXISTS `damage_report`;

CREATE TABLE `damage_report` (
  `damrep_id` int(8) NOT NULL auto_increment,
  `damage_type` varchar(30) NOT NULL,
  `estimated_cost` decimal(8,2) NOT NULL,
  `brgy_id` int(8) NOT NULL,
  `res_id` int(8) NOT NULL,
  `date_added` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  `calamity` varchar(30) NOT NULL default 'typhoon',
  `date_calamity` date NOT NULL,
  PRIMARY KEY  (`damrep_id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

/*Data for the table `damage_report` */

insert  into `damage_report`(`damrep_id`,`damage_type`,`estimated_cost`,`brgy_id`,`res_id`,`date_added`,`calamity`,`date_calamity`) values (5,'Appliances  ',10000.00,0,2,'2019-03-03 20:50:04','typhoon','2019-03-03'),(4,'Partial Damage',200000.00,0,3,'2019-03-03 19:21:15','typhoon','2019-03-03');

/*Table structure for table `evaluation_criteria` */

DROP TABLE IF EXISTS `evaluation_criteria`;

CREATE TABLE `evaluation_criteria` (
  `evalc_id` int(8) NOT NULL auto_increment,
  `damage_type` varchar(30) NOT NULL,
  `description` varchar(100) NOT NULL,
  `date_added` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (`evalc_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

