/*Table structure for table `damage_assessment_cost` */

DROP TABLE IF EXISTS `damage_assessment_cost`;

/*!50001 DROP VIEW IF EXISTS `damage_assessment_cost` */;
/*!50001 DROP TABLE IF EXISTS `damage_assessment_cost` */;

/*!50001 CREATE TABLE  `damage_assessment_cost`(
 `calamity` varchar(30) ,
 `date_calamity` date ,
 `totalcost` decimal(30,2) ,
 `brgy_id` int(8) 
)*/;

/*View structure for view damage_assessment_cost */

/*!50001 DROP TABLE IF EXISTS `damage_assessment_cost` */;
/*!50001 DROP VIEW IF EXISTS `damage_assessment_cost` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `damage_assessment_cost` AS (select `damage_report`.`calamity` AS `calamity`,`damage_report`.`date_calamity` AS `date_calamity`,sum(`damage_report`.`estimated_cost`) AS `totalcost`,`damage_report`.`brgy_id` AS `brgy_id` from `damage_report` group by `damage_report`.`brgy_id`,`damage_report`.`calamity`,month(`damage_report`.`date_calamity`)) */;

